CREATE TABLE `users` (
  `id` int UNSIGNED PRIMARY KEY,
  `login` varchar(255) UNIQUE,
  `password` varchar(60),
  `email` varchar(255) UNIQUE,
  `phone` varchar(255) UNIQUE,
  `name` varchar(255),
  `surname` varchar(255),
  `trans` varchar(255),
  `description` mediumtext,
  `type` int NOT NULL DEFAULT '0',
  `status` tinyint(1) NOT NULL DEFAULT '0',
  `id_google` varchar(255) UNIQUE,
  `id_github` varchar(255) UNIQUE,
  `id_bitbucket` varchar(255) UNIQUE,
  `id_vkontakte` varchar(255) UNIQUE,
  `id_facebook` varchar(255) UNIQUE,
  `id_yandex` varchar(255) UNIQUE,
  `gender` varchar(255),
  `coordinate_lat` double DEFAULT NULL,
  `coordinate_lng` double DEFAULT NULL,
  `token` varchar(100),
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `online_at` timestamp NULL DEFAULT NULL,
  `token_at` timestamp NULL DEFAULT NULL
);

